import React from "react";

const Home = () => {
  return (
    <div>
      <h1>Welcome to Car Rescue Service</h1>
      <p>Book a flatbed truck for your car rescue anytime, anywhere.</p>
      <a href="/booking">
        <button>Book Now</button>
      </a>
    </div>
  );
};

export default Home;
